  `disk_status` int(11) DEFAULT NULL,
  `cabinet_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=323 DEFAULT CHARSET=utf8 COMMENT='忠实记录DISKINFO执行过程';
